import { getSearchId } from "../actions"

export const fetchSearchId = () => {
  return dispatch => {
    fetch('https://aviasales-test-api.kata.academy/search')
      .then(response => response.json())
      .then(res => {
        console.log(res)
        dispatch(getSearchId(res.seahId))
      })
  }
}
